import logo from "./logo.svg";
import "./App.css";
import Login from "./components/Login";
import {BrowserRouter as Router, Switch, Route} from "react-router-dom";

function App() {
  return (
    <div className="App">
      <Router>
        <Route excat path="/">
          <Login />
        </Route>
        Route exact path="/admin" render=
        {(routeProps) => (
          <CategoryList categories={seedWorkers} {...routeProps} />
        )}
        />
      </Router>
    </div>
  );
}

export default App;
